import React, {Component} from 'react';
import { Container, Col } from 'react-bootstrap';
import {Link} from 'react-router-dom';

class Regist extends Component {
    render(){
        return (
            <Container className="mt-5">
                <Col md={6} className="mx-auto bg-info rounded text-center">
                    <div>
                        <h4 className="pt-2 text-light">Regist</h4>
                        <Link to="/login">
                            <p className="badge badge-danger mt-4">Sudah punya akun? Login!</p>
                        </Link>
                    </div>
                </Col>
            </Container>
        )
    }
}

export default Regist;
